import React from 'react';
import NavBar from "./NavBar";
import Services from "./Services";

class App extends React.Component{

    type=0

    render() {
        if (this.type=0){
            return(
                <div>
                    <NavBar/>
                    <div className="ui segment">
                        <Services type="Donate"/>
                    </div>
                </div>


            )
        }
    }

}

export default App
